    data: |
      SELECT DISTINCT - col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE - col0 NOT BETWEEN NULL AND + + 49 + - - col0 + - CAST ( NULL AS INTEGER );
  - name: tab1

outputs:
  - name: q1201.out
    data: |
